pragma solidity ^0.6.0;

import "./utility/Lockable.sol";
import "./utility/Ownable.sol";
import "./utility/Whitelist.sol";
import "./utility/Address.sol";
import "./interfaces/IBurner.sol";

/**
 * @title Registry contract 
 */

contract Registry is Lockable, Whitelist {

    using Address for address;

    // Synthetics Array
    address[] public syntheticArray;
    // Count of Synthetics Enabled
    uint256 public syntheticCount;
    // Enabled Synthetics(Synthetic Address => bool).
    mapping(address => bool) public synthetics;
    // Token Factory address
    address tokenFactoryAddress;

    event EnabledSynthetic(address indexed syntheticToken);
    event DisabledSynthetic(address indexed syntheticToken);

    /**
     * @param _tokenFactoryAddress token factory contract address
     */
    constructor(
        address _tokenFactoryAddress
    ) public nonReentrant()  {
        address sender = _msgSender();

        tokenFactoryAddress = _tokenFactoryAddress;
        addAddress(sender);
    }

    /**
     * @dev Check if Synthetic addresses are enabled.
     * @param _synthetics Array of Synthetic Addresses.
     */
    function isSynthetic(address[] calldata _synthetics)
        external
        view
        returns (bool isOk)
    {
        isOk = true;
        for (uint256 i = 0; i < _synthetics.length; i++) {
            if (!synthetics[_synthetics[i]]) {
                isOk = false;
                break;
            }
        }
    }

    /**
     * @dev get Synthetic's Array length.
     */
    function syntheticLength() external view returns (uint256) {
        return syntheticArray.length;
    }

    /**
     * @dev Enable Synthetic.
     * @param _synthetic Synthetic Address.
     */
    function enableSynthetic(address _synthetic)
        external
        nonReentrant()
        onlyWhitelisted()
    {
        require(!synthetics[_synthetic], "Already Enabled");
        _add(_synthetic);
        synthetics[_synthetic] = true;
        syntheticCount++;
        emit EnabledSynthetic(_synthetic);
    }

    /**
     * @dev Disable Synthetic.
     * @param _synthetic Synthetic Address.
     */
    function disableSynthetic(address _synthetic)
        external
        nonReentrant()
        onlyWhitelisted()
    {
        require(synthetics[_synthetic], "Already Disabled");
        delete synthetics[_synthetic];
        syntheticCount--;
        emit DisabledSynthetic(_synthetic);
    }


    /**
     * @dev Add Synthetic to Synthetic's array.
     * @param _synthetic Synthetic Address.
     **/
    function _add(address _synthetic) internal {
        require(_synthetic != address(0), "Given address is not valid");

        IBurner(_synthetic).getName(); // Checking if _synthetic has function getName()
        syntheticArray.push(_synthetic);
    }

}
